    "February",
    "March",
    "April",
    "May",
    "June",
    "July",
  ];

  const random = Math.floor(Math.random() * months.length);
  console.log(random, months[random]);

  return (
    <div className="jokes">
      <button>產生隨機笑話</button>
      <br />
      <br />
      <br />
      {text}
    </div>
  );
};
export default Jokes;
